"use strict";(self.webpackChunkdocusaurus_demo=self.webpackChunkdocusaurus_demo||[]).push([[26],{4852:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/intro","metadata":{"permalink":"/TP3/blog/intro","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/intro.md","source":"@site/blog/intro.md","title":"Quem Somos","description":"Uma oficina automotiva \xe9 muito mais do que um simples local de reparo para ve\xedculos; \xe9 um espa\xe7o onde a paix\xe3o por autom\xf3veis encontra a expertise t\xe9cnica. Imagine um lugar onde os motores roncam como uma sinfonia de pot\xeancia e os profissionais s\xe3o verdadeiros maestros na arte de manter e aprimorar o desempenho de seu ve\xedculo.","date":"2023-12-21T19:48:25.000Z","formattedDate":"December 21, 2023","tags":[],"readingTime":1.64,"hasTruncateMarker":false,"authors":[],"frontMatter":{"sidebar_position":1}},"content":"Uma oficina automotiva \xe9 muito mais do que um simples local de reparo para ve\xedculos; \xe9 um espa\xe7o onde a paix\xe3o por autom\xf3veis encontra a expertise t\xe9cnica. Imagine um lugar onde os motores roncam como uma sinfonia de pot\xeancia e os profissionais s\xe3o verdadeiros maestros na arte de manter e aprimorar o desempenho de seu ve\xedculo. \\n\\n## Nesta oficina fazemos os diferentes tipos de trabalhos:\\n\\n### Manuten\xe7\xe3o B\xe1sica:\\nTroca de \xf3leo e filtro.\\nVerifica\xe7\xe3o e substitui\xe7\xe3o de fluidos (freio, transmiss\xe3o, dire\xe7\xe3o hidr\xe1ulica, refrigerante, etc.).\\nInspe\xe7\xe3o e substitui\xe7\xe3o de filtros de ar e de combust\xedvel.\\nVerifica\xe7\xe3o e ajuste de press\xe3o dos pneus.\\n\\n### Reparos Mec\xe2nicos:\\nDiagn\xf3stico e reparo de problemas no motor.\\nTroca de correias e tensores.\\nSubstitui\xe7\xe3o de velas de igni\xe7\xe3o e cabos.\\nReparos no sistema de escape.\\n\\n### Sistema de Freios:\\nSubstitui\xe7\xe3o de pastilhas e discos de freio.\\nReparo ou substitui\xe7\xe3o de cilindros mestres e cilindros de roda.\\nSangria e substitui\xe7\xe3o do fluido de freio.\\n\\n### Suspens\xe3o e Dire\xe7\xe3o:\\nAlinhamento e balanceamento de rodas.\\nSubstitui\xe7\xe3o de amortecedores e molas.\\nReparo ou substitui\xe7\xe3o de componentes da dire\xe7\xe3o.\\n\\n### Sistema El\xe9trico:\\nDiagn\xf3stico e reparo de problemas el\xe9tricos.\\nSubstitui\xe7\xe3o de baterias e alternadores.\\nInstala\xe7\xe3o e reparo de sistemas el\xe9tricos adicionais (far\xf3is, r\xe1dios, alarmes, etc.).\\n\\n### Transmiss\xe3o e Embreagem:\\nTroca de fluido da transmiss\xe3o.\\nDiagn\xf3stico e reparo de problemas na transmiss\xe3o.\\nSubstitui\xe7\xe3o da embreagem.\\n\\n### Ar Condicionado e Aquecimento:\\nRecarga de refrigerante do ar condicionado.\\nDiagn\xf3stico e reparo de sistemas de aquecimento e ar condicionado.\\n\\n### Servi\xe7os de Pneus:\\nTroca e reparo de pneus.\\nRod\xedzio de pneus.\\nBalanceamento e alinhamento.\\n\\n### Diagn\xf3stico Eletr\xf4nico:\\nUtiliza\xe7\xe3o de ferramentas de diagn\xf3stico para identificar problemas eletr\xf4nicos.\\nLeitura e interpreta\xe7\xe3o de c\xf3digos de falha.\\n\\n### Personaliza\xe7\xe3o e Melhorias:\\nInstala\xe7\xe3o de acess\xf3rios (r\xe1dios, sistemas de navega\xe7\xe3o, etc.).\\nUpgrades de desempenho (freios esportivos, escapamentos esportivos, etc.).\\n\\n### Servi\xe7os de Funilaria e Pintura:\\nReparos em amassados e arranh\xf5es.\\nPintura e repintura de partes danificadas.\\n\\n### Inspe\xe7\xf5es e Emiss\xe3o de Documentos:\\nInspe\xe7\xf5es veiculares.\\nEmiss\xe3o de laudos para transfer\xeancia e regulariza\xe7\xe3o."}]}')}}]);